import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-column">
        <h3>About Farfetch</h3>
        <p>Farfetch is a global platform for luxury fashion.</p>
        <p>Learn more about us.</p>
      </div>
      <div className="footer-column">
        <h3>Customer Service</h3>
        <p>Contact us</p>
        <p>FAQ</p>
      </div>
      <div className="footer-column">
        <h3>The Company</h3>
        <p>Careers</p>
        <p>Press</p>
      </div>
    </div>
  );
};

export default Footer;
